INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (2.21, 2, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 3001, 2, 1, 12300149, "vo_minigame_1012_result_1081", 0, 5, 1, 9, 8);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (2.46, 2, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 3001, 2, 1, 12300150, "vo_minigame_1012_result_1082", 0, 5, 1, 9, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (2.94, 2, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 3001, 2, 1, 12300151, "vo_minigame_1012_result_1083", 0, 5, 1, 9, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (4.19, 2, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 3001, 3, 1, 12300152, "vo_minigame_1012_result_1084", 0, 5, 1, 9, 7);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (0.0, 2, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 3001, 3, 1, 12300153, "vo_minigame_1012_result_1085", 0, 5, 1, 9, 1);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (2.63, 2, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 3001, 3, 1, 12300154, "vo_minigame_1012_result_1086", 0, 5, 1, 9, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (5.53, 2, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 3001, 1, 1, 12300155, "vo_minigame_1012_result_1087", 0, 1, 1, 4, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (0.01, 2, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 3001, 1, 1, 12300156, "vo_minigame_1012_result_1088", 9, 1, 3, 4, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (4.15, 2, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 3001, 1, 1, 12300157, "vo_minigame_1012_result_1089", 3, 1, 1, 4, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (0.01, 2, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 3001, 2, 1, 12300158, "vo_minigame_1012_result_1090", 9, 1, 9, 4, 9);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (5.37, 2, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 3001, 2, 1, 12300159, "vo_minigame_1012_result_1091", 0, 1, 1, 4, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (1.44, 2, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 3001, 2, 1, 12300160, "vo_minigame_1012_result_1092", 0, 1, 1, 4, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (0.0, 2, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 3001, 3, 1, 12300161, "vo_minigame_1012_result_1093", 0, 1, 3, 4, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (2.91, 2, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 3001, 3, 1, 12300162, "vo_minigame_1012_result_1094", 3, 1, 9, 4, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (2.61, 2, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 3001, 3, 1, 12300163, "vo_minigame_1012_result_1095", 0, 1, 1, 4, 5);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (3.63, 2, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 3001, 1, 1, 12300164, "vo_minigame_1012_result_1096", 1, 0, 2, 0, 4);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (4.16, 2, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 3001, 1, 1, 12300165, "vo_minigame_1012_result_1097", 1, 0, 2, 0, 6);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (0.01, 2, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 3001, 1, 1, 12300166, "vo_minigame_1012_result_1098", 6, 0, 3, 0, 3);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (5.75, 2, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 3001, 2, 1, 12300167, "vo_minigame_1012_result_1099", 0, 0, 2, 0, 6);
INSERT INTO `v1_4746f9dd405caf7d9e4399408048f567bf4487c18131222ae8168f4d633e82f5` VALUES (5.64, 2, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 3001, 2, 1, 12300168, "vo_minigame_1012_result_1100", 1, 0, 2, 0, 4);
